Tere Marin M
September 2 at 8:09 PM ·

@evoespueblo
Facebook eliminó red de páginas de desinformación que trabajaba para el gobierno de facto de #Bolivia. Millones de dólares de dineros públicos fueron invertidos para difundir Fake News y mentiras, lo cual obliga al Ministerio Público a investigar, y a la población a estar alerta.

@evoespueblo
Facebook y Twitter, herramientas para comunicarnos, se usan para una guerra sucia contra
@BOmereceMAS
desde 68.000 cuentas falsas creadas desde golpe de Estado en #Bolivia. Hoy, Facebook dio un paso al eliminar una red contratada por gobierno de facto para difundir sus mentiras.

