@evoespueblo
El @TSEBolivia inhabilitó a más de 50.000 ciudadanos del padrón electoral del exterior porque no votaron en dos elecciones; solo en #Argentina anularon a 24.000 votantes. El plazo para reclamo es corto y, por lo mismo, el apoyo debe ser máximo para garantizar este derecho.

